window.bookSummaryJSON = "<p>Pyper and Julius are getting married. There's a wedding to plan, dresses to order, and daiquiris to consume. But when an old curse rears its ugly head and ends in a murder, Pyper's younger brother Bo is suddenly in danger of being charged with a crime he didn't commit.</p> <p>Now Pyper and her friends are racing against time to clear Bo's name and neutralize the curse before it claims another life. With a little help from the ghosts of New Orleans, Pyper's determined to save the day and still find her perfect wedding dress. <br> </p>"; 
